<div class="coming-wrap">
    <div class="container">
        <div class="row">
            <div class="col-md-12">
                <a class="error-logo" href="/"><img alt="coming-logo" src="/images/soccer/coming-logo.png"></a>
            </div>
        </div>
    </div>
    <div class="coming-title">
        <div class="container">
            <div class="row">
                <div class="col-md-12">
                    <span class="big-text">Cooming soon...</span>
                    <div class="counter">
                        <ul>
                            <li>
                                <div class="digit">6</div>
                                <div class="descr">days</div>
                            </li>
                            <li>
                                <div class="digit">20</div>
                                <div class="descr">hours</div>
                            </li>
                            <li>
                                <div class="digit">37</div>
                                <div class="descr">minutes</div>
                            </li>
                            <li>
                                <div class="digit">04</div>
                                <div class="descr">seconds</div>
                            </li>
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    </div>
</div>
